import React, { useEffect, useState } from 'react';
import axios from 'axios';

const QuizResults = () => {
  const [quizResults, setQuizResults] = useState([]);

  useEffect(() => {
    const fetchQuizResults = async () => {
      try {
        const response = await axios.post('http://localhost:5164/viewResult', { email: "example@email.com" });
        if (response.status === 200) {
          const responseData = response.data;
          if (responseData.rData && responseData.rData.items) {
            setQuizResults(responseData.rData.items);
            console.log("Quiz Results:", responseData.rData.items);
          } else {
            console.log("No quiz results data in response");
          }
        }
      } catch (error) {
        console.error("Error fetching quiz results:", error);
      }
    };

    fetchQuizResults();
  }, []);

  return (
    <div>
      <h2>My Quiz Results</h2>
      <table>
        <thead>
          <tr>
            <th>Quiz</th>
            <th>Correct Answers</th>
            <th>Incorrect Answers</th>
            <th>Score</th>
          </tr>
        </thead>
        <tbody>
          {quizResults.map((result, index) => (
            <tr key={index}>
              <td>{result.quiz_name}</td>
              <td>{result.correct_answer}</td>
              <td>{result.incorrect_answer}</td>
              <td>{result.score}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default QuizResults;
